import React from 'react';
import {
  Card, CardBody, CardImg, CardTitle, CardSubtitle, CardText
} from 'reactstrap';
import Papa from 'papaparse'
import Logo from './restaurant.png';
import Icon from './restaurant_1.png'

class ListRestaurants extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    }
    this.updateData = this.updateData.bind(this);
  }

  componentWillMount() {
    const csvFilePath='src/restaurants.csv'
    const csv=require('csvtojson')
    csv()
    // .fromFile(csvFilePath)
    .then((jsonObj)=>{
      console.log(jsonObj);
   })
  }

  updateData(updatedData) {
    this.setState({ data: updatedData.data });
  }

  render() {
    const { data } = this.state;
    const filteredData = data.slice(0, 20)
    console.log(filteredData);
    return (
      <React.Fragment>
        <div className='page-header d-flex align-items-center'>
          <div className='mr-auto'>
            <img  src={Logo} alt='loading...' className='img'/>
            <h3>Restaurants</h3>
          </div>
        </div>
        <div className='page-content d-flex align-items-center'>
          <Card>
            <CardBody>
              {
                filteredData.map((item) => {
                  return (
                    <Card>
                      <CardImg top width="100%" src={Icon} alt="Card image cap" />
                      <CardBody>
                        <CardTitle>{item.title}</CardTitle>
                        <CardSubtitle>Card subtitle</CardSubtitle>
                        <CardText>Some quick example text to build on the card title and make up the bulk of the card's content.</CardText>
                      </CardBody>
                    </Card>
                  );
                })
              }
            </CardBody>
          </Card>
        </div>
      </React.Fragment>
    )
  }
}

export default ListRestaurants;
